import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { SocketProvider } from './contexts/SocketContext';
import Navbar from './components/Layout/Navbar';
import Footer from './components/Layout/Footer';
import Chatbot from './components/Chatbot/Chatbot';
import ProtectedRoute from './components/Auth/ProtectedRoute';

// Pages
import Home from './pages/Home';
import Destinations from './pages/Destinations';
import DestinationDetail from './pages/DestinationDetail';
import ItineraryPlanner from './pages/ItineraryPlanner';
import ItineraryDetail from './pages/ItineraryDetail';
import Marketplace from './pages/Marketplace';
import ProductDetail from './pages/ProductDetail';
import ServiceDetail from './pages/ServiceDetail';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Profile from './pages/Profile';
import Dashboard from './pages/Dashboard';
import Analytics from './pages/Analytics';
import NotFound from './pages/NotFound';
import PlacesToVisit from './pages/PlacesToVisit';

import './App.css'; // Add global theme styles

function App() {
    return (
        <AuthProvider>
            <SocketProvider>
                <Router>
                    <div className="App">
                        <Navbar />
                        <main className="min-h-screen">
                            <Routes>
                                {/* Public Routes */}
                                <Route path="/" element={<Home />} />
                                <Route path="/destinations" element={<Destinations />} />
                                <Route path="/destinations/:id" element={<DestinationDetail />} />
                                <Route path="/marketplace" element={<Marketplace />} />
                                <Route path="/marketplace/products/:id" element={<ProductDetail />} />
                                <Route path="/marketplace/services/:id" element={<ServiceDetail />} />
                                <Route path="/login" element={<Login />} />
                                <Route path="/register" element={<Register />} />
                                <Route path="/places-to-visit" element={<PlacesToVisit />} />

                                {/* Protected Routes */}
                                <Route path="/itinerary-planner" element={
                                    <ProtectedRoute>
                                        <ItineraryPlanner />
                                    </ProtectedRoute>
                                } />
                                <Route path="/itinerary/:id" element={
                                    <ProtectedRoute>
                                        <ItineraryDetail />
                                    </ProtectedRoute>
                                } />
                                <Route path="/profile" element={
                                    <ProtectedRoute>
                                        <Profile />
                                    </ProtectedRoute>
                                } />
                                <Route path="/dashboard" element={
                                    <ProtectedRoute>
                                        <Dashboard />
                                    </ProtectedRoute>
                                } />
                                <Route path="/analytics" element={
                                    <ProtectedRoute allowedRoles={['admin']}>
                                        <Analytics />
                                    </ProtectedRoute>
                                } />

                                {/* 404 Route */}
                                <Route path="*" element={<NotFound />} />
                            </Routes>
                        </main>
                        <Footer />
                        <Chatbot />
                    </div>
                </Router>
            </SocketProvider>
        </AuthProvider>
    );
}

export default App;
